import Bike from "./bike";
import Showroom from "./showroom";
function car() {
  const brand = "Farraricar";
  const text = `I Am A ${brand}`;
  const maintain = "Owner";
  const bikedetails = { rate: "3.5 lakh", warenty: "2 years" };
  //  const bikedetails={};
  const showroomitems = { twowheel: "Bike", fourwheel: "Car" };
  const bikeinfo =
    bikedetails.rate !== undefined && bikedetails.warenty !== undefined;

  const bikerate = [
    { rate: "2 lakh", warenty: "1 year" },
    { rate: "3 lakh", warenty: "3 year" },
    { rate: "1 lakh", warenty: "1.5 year" },
  ];
  return (
    <>
      <h2>{text}</h2>
      {bikeinfo && (
        <Bike maintain={maintain} color={"White"} bikeinfo={bikedetails} />
      )}
      <Showroom showroomitems={showroomitems} />
      <ul>
        {bikerate.map((bike_detail) => (
          <li >
            <Bike maintain={maintain} color={"Red"} bikeinfo={bike_detail} />
          </li>
        ))}
      </ul>
    </>
  );
}
export default car;
